import React from 'react';
import SearchBar from "./searchBar";
import axios from 'axios';

class App extends React.Component{

    async getAction(term){
        console.log(term+" on Action");
        response= await axios.get("https://api.unsplash.com/search/photos",{
            params: {
                query:term
            },
            headers:{
                Authorization: 'Client-ID bmDzue1ffMEQZ4lPNEVS8IGgMAz6UkB7rZzlO_HC-GA'
            }
        });
        console.log(response.data.results);
    }
    render(){
        return (<div className="ui container" ><SearchBar onAction={this.getAction} /></div>);
    }
}

export default App;
